function App() {
  const [data, setData] = useState(undefined);
  const token =
    "BQB3lOxrKzFM74WfohEo1rfLo7TKz2x0htUjfzKdW1xzHeaX5Xz3z-biB_1QMxRh7NhXDf69tTiyN0DtQ6nv3si17u_0V-zlGiIoZMpZT0O3U0lguaqpz0-IEOtxTp3F6QVjp_26Q3QcnJaRcOdSTjWZovdPOzbuboI";
  const search = "kendrick";
  async function fetchData() {
    const response = await fetch(
      `https://api.spotify.com/v1/search?q=${search}&type=album,track,artist`,
      {
        headers: {
          Authorization: `Bearer ${token}`,
        },
      }
    );
    const info = await response.json();
    return await info;
  }
  useEffect(() => {
    fetchData().then((info) => {
      setData(info);
    });
  }, []);
  if (
    data.albums.items == undefined ||
    data.tracks.items == undefined ||
    data.artists.items == undefined
  ) {
    return;
  }
  const albums = data.albums.items;
  const artists = data.artists.items;
  const tracks = data.tracks.items;
  return (
    <div className="App">
      (
      <div>
        {albums.map((album, index) => (
          <p>{album}</p>
        ))}
      </div>
      )
    </div>
  );
}

export default App;
